import React from 'react'; 

import Photo from '../components/Image/Image'
import ContactCard from '../components/Contact/Contact'




function HomePage () {


    return (
      <div className="App">
      <Container>
        <Row>
          <Col sm={6}>
        <Photo/>
        </Col>
        <Col sm={6}>
        <ContactCard/>
        </Col>
        </Row>
        </Container>


      </div>
    );
  }


export default HomePage;
